Que andava a passear.
Caminhava pela praia, 
E só queria explorar.

Certa vez viu um barquinho, 
Lá longe, lá no mar,
E mal viu esse barquinho,
Só o queria alcançar.

Então começou a correr,
Pela areia, até ao mar,
Mas mal pisou na água, 
Começou a congelar .

A água estava fria, 
Não a podia aguentar,
Mas se ela se fosse embora,
Não o conseguia apanhar.

O barquinho ainda longe, 
A menina a desanimar,
Então ela decidiu, 
Erguer-se para o mar.

Percebeu que sem dar luta, 
Não iria a lado nenhum.
Então teve de ser astuta,
A menina que se esforçou ,
Pelo seu objetivo lutou, 
E a felicidade alcançou.
