 Meet the Panelists:

3.       Saheed Balogun, Senior Special Assistant to Lagos State Governor on Science and Technology @lagosstategovt 

BALOGUN, Saheed Olusola
Senior Special Assistant to the Governor on Science and Technology

Saheed has over 15 years of professional work experience within and outside Nigeria. Some of the projects handled include, Revenue Assurance and Budget management technology tools, Smart Government Initiatives in the Middle-East (Dubai, Riyadh and Abudhabi) to derive socio-economic and socio-technical benefits, working with leading telecoms firms in the development of platforms that support Smart City initiatives in the public services such as Security, inter-governmental relations, Education, Transport and seamless connectivity on Metro lines.

He was recruited as a consultant to Cisco Systems to strengthen their professional services team in the Telecoms and Enterprise business units. In the last 8 years with Cisco, he has worked on planning, rollout and developing budgets for the building technology platforms in the Telecoms and Oil & gas industries within and outside Nigeria. 

Saheed is exposed to the use of Information technology in the optimal management of networks and systems, Smart Economy and Smart City solutions. He is also the founder of www.Kara.com.ng the winner of the E-Commerce Website Start-Up of the Year, 2016 by Nigeria Technology Awards (NITA). He also earned an Award of Honor from the prestigious Science Association of Nigeria (SAN) for his contribution to the development of Science Education.

Saheed will talk us through how to build a personal brand that will stand the test of time.

The JCI Eko BMC 10.0 Panel Session will be immersive, enriching, enlightening and most of all rewarding as the list of our Panelists ensures the unity of all sectors of the economy to uphold the JCI Eko’s culture of excellence.  Date - ‪Sunday, September 6, 2020‬
Time - ‪1:00pm (WAT)‬
Venue - Zoom  
